func _TestPostRedirects(t *testing.T) {
	jar := request.Jar()
	cs := request.ClientSettings{
		SkipCertChecks: true,
		//Proxy: "127.0.0.1:8888",
	}

	resp, err := request.Do(request.Options{
		Method: "GET",
		URL:    "https://kith.com/checkpoint",
		Headers: request.Headers{
			"upgrade-insecure-requests": "1",
			"user-agent":                "Mozilla/5.0 (Windows NT 10.0; Win64; x64) AppleWebKit/537.36 (KHTML, like Gecko) Chrome/87.0.4280.88 Safari/537.36",
			"accept":                    "text/html,application/xhtml+xml,application/xml;q=0.9,image/avif,image/webp,image/apng,*/*;q=0.8,application/signed-exchange;v=b3;q=0.9",
			"sec-fetch-site":            "none",
			"sec-fetch-mode":            "navigate",
			"sec-fetch-user":            "?1",
			"sec-fetch-dest":            "document",
			"accept-encoding":           "gzip, deflate, br",
			"accept-language":           "en-US,en;q=0.9",
		},
		HeaderOrder: request.HeaderOrder{
			"upgrade-insecure-requests",
			"user-agent",
			"accept",
			"sec-fetch-site",
			"sec-fetch-mode",
			"sec-fetch-user",
			"sec-fetch-dest",
			"accept-encoding",
			"accept-language",
			"cookie",
		},
		FollowRedirects: true,
		Jar:             jar,
		ClientSettings:  &cs,
	})

	if err != nil {
		t.Error(err)
		return
	}

	authTokenRegex, err := regexp.Compile("name=\"authenticity_token\" value=\"[^\"]+")
	if err != nil {
		t.Error(err)
		return
	}
	authToken := authTokenRegex.FindString(resp.Body)
	authToken = strings.Replace(authToken, "name=\"authenticity_token\" value=\"", "", -1)

	_, err = request.Do(request.Options{
		Method: "POST",
		URL:    "https://kith.com/checkpoint",
		Headers: request.Headers{
			//"content-length": "1861",
			"cache-control":             "max-age=0",
			"upgrade-insecure-requests": "1",
			"origin":                    "https://kith.com",
			"content-type":              "application/x-www-form-urlencoded",
			"User-Agent":                "Mozilla/5.0 (Windows NT 10.0; Win64; x64) AppleWebKit/537.36 (KHTML, like Gecko) Chrome/87.0.4280.88 Safari/537.36",
			"accept":                    "text/html,application/xhtml+xml,application/xml;q=0.9,image/avif,image/webp,image/apng,*/*;q=0.8,application/signed-exchange;v=b3;q=0.9",
			"sec-fetch-site":            "same-origin",
			"sec-fetch-mode":            "navigate",
			"sec-fetch-user":            "?1",
			"sec-fetch-dest":            "document",
			"referer":                   "https://kith.com/checkpoint",
			"accept-encoding":           "gzip, deflate, br",
			"accept-language":           "en-US,en;q=0.9",
			"x-extra-header":            "true",
		},
		HeaderOrder: request.HeaderOrder{
			"content-length",
			"cache-control",
			"upgrade-insecure-requests",
			"origin",
			"content-type",
			"user-agent",
			"accept",
			"sec-fetch-site",
			"sec-fetch-mode",
			"sec-fetch-user",
			"sec-fetch-dest",
			"referer",
			"accept-encoding",
			"accept-language",
			"cookie",
		},
		FollowRedirects: true,
		Jar:             jar,
		ClientSettings:  &cs,
		Form: request.JSON{
			"authenticity_token":   authToken,
			"g-recaptcha-response": "whatever",
			"data_via":             "cookie",
			"commit":               "",
		},
	})

	if err != nil {
		t.Error(err)
		return
	}
}

